import axios from 'axios';
import {useEffect, useState} from 'react';
import './App.css';

import Header from './components/header.jsx';

const baseURL= "http://localhost:8080";
function App() {
  const [message, setMessage]= useState("Jola");

  useEffect(()=>{
    const getMesseage= async ()=>{
      await axios.get(baseURL).then(res=>{
        setMessage(res.data);
      });
    }
   getMesseage(); 
  }, [message]);
  return (<div>
  <br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/>v<br/><br/><br/><br/><br/><br/><br/>v<br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/>hjkkl;;jdtujhhjitgj<br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/><br/>
    <Header />
  </div>
  );
}

export default App;
